  input: TEXT,SA11A1,SA11A1.63185,"On 8/29/06 we received a contribution from Larry
    Contos in the amount of $10,000 which was deposited into our federal account.  Two
    hundred and fifty dollars was transferred to our non-federal account, which can
    accept unlimited contributions from individuals, on 8/31/06.  A letter was sent
    to Larry Contos advising him of how his contribution was split into our accounts
    and to offer him a chance for a refund.  According to AO 2001-17, the Commission
    has deemed it sufficient to deposit checks that exceed the donor's federal limits
    into our federal account and then to make a transfer to the non-federal account
    for the portion that is over the federal limit.  However when preparing our report
    it was noted that Larry's overage was $750 and not $250.  Therefore on 9/20/06
    a transfer will be made from our federal account to our non-federal account of
    $500 to correct Larry Contos' federal limits.  "
