    Hannum in the amount of $15,000 which was deposited into our federal account.  Five
    thousand dollars was transferred to our non-federal account, which can accept
    unlimited contributions from individuals, on 8/2/06.  A letter was sent to David
    Hannum advising him of how his contribution was split into our accounts and to
    offer him a chance for a refund.  According to AO 2001-17, the Commission has
    deemed it sufficient to deposit checks exceeding the federal limits into the federal
    account and then to make a transfer to the non-federal account for the portion
    that is over the federal limit.  Therefore, year to date aggregate totals reported
    to David Hannum on our report is a reflection of the federal portion of the donor's
