  input: TEXT,SA11C,SA11C.62747,"On 8/4/06 we received a contribution from the OLBANK
    PAC in the amount of $10,000 which was deposited into our federal account.  Five
    thousand dollars was transferred to our non-federal account, which can accept
    unlimited contributions from PACs, on 8/4/06.  A letter was sent to the PAC advising
    them of how their contribution was split into our accounts and to offer them a
    chance for a refund.  According to AO 2001-17, the Commission has deemed it sufficient
    to deposit checks exceeding the federal limits into the federal account and then
    to make a transfer to the non-federal account for the portion that is over the
    federal limit.  Therefore, the year to date aggregate totals reported by the OLBANK
    PAC on our report is a reflection of the federal portion of the donor's contribution
    to date."
